import React from 'react';
import { useParams } from 'react-router';

const Booking = () => {
    const { serviceId } = useParams();
    return (
        <div>
            <h2>This is Booking {serviceId}</h2>
        </div>
    );
};

export default Booking; <h2>This is Booking</h2>
